import React from "react";
import Button from "@material-ui/core/Button";
import {
  Paper,
  Container,
  CssBaseline,
  Typography,
  TextField,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  main: {
    padding: theme.spacing(14),
  },
  newContainer: {
    padding: theme.spacing(3),
  },
  textInput: {
    width: "100%",
    margin: theme.spacing(1, 0),
  },
}));

function Title() {
  return (
    <>
      <Typography
        component="h1"
        variant="h2"
        align="center"
        color="textPrimary"
      >
        hmm
      </Typography>
      <Typography
        component="h5"
        variant="h6"
        align="center"
        color="textPrimary"
        gutterBottom
      >
        what's on your mind?
      </Typography>
    </>
  );
}

function Form(props) {
  const classes = props.classes;
  return (<Container maxWidth="sm">
    <Paper className={classes.newContainer}>
      <Typography
        component="h3"
        variant="h4"
        align="center"
        color="textSecondary"
      >
        New
      </Typography>
      <TextField
        required
        className={classes.textInput}
        id="outlined-required"
        label="Title"
        variant="outlined"
      />

      <TextField
        required
        id="outlined-multiline-static"
        className={classes.textInput}
        label="Main content"
        multiline
        rows={5}
        variant="outlined"
      />
    </Paper>
  </Container>);
}

function App() {
  const classes = useStyles();

  return (
    <main className={classes.main}>
      <Container component="main" maxWidth="md">
        <CssBaseline />
        <Title />
        <Form classes={classes} />
      </Container>
    </main>
  );
}

export default App;
